export default function Experience(props){
    let experince=props.content;
    return(
        <>
        {
            experince.map((el,index)=>(
                <div key={index} class="flex gap-2 items-center">
                    <img src={el.companyLogo}></img>
                    <div>
                        <p class="font-bold text-2xl">{el.name}</p>
                        <p class="text-slate-600">{el.position}</p>
                        <p class="text-xs">{el.startDate}&nbsp;-&nbsp;{!el.endDate? 'Present':el.endDate}</p>
                    </div>
                    <p dangerouslySetInnerHTML={el.description}></p>
                </div>
            ))
        }
        </>
    )
}
